'use client'

import { useIntersectionObserver } from '@/src/hooks';
import { cn } from '@/src/lib/utils';
import Image from 'next/image';

export const ImageAbout = () => {
  const { elementRef, isIntersecting } = useIntersectionObserver({
    threshold: 0.1,
    triggerOnce: true
  });
  return (
    <div className="w-full lg:w-[50%] z-10 max-w-[500px]">
      <Image
      ref={elementRef as React.RefObject<HTMLImageElement>} 
      src={"/draw.webp"} 
      alt="Lima, Per√∫" 
      width={500} 
      height={500} 
      className={cn("aspect-square rounded-lg", {'animate-scale-in opacity-100': isIntersecting}, {'opacity-0 translate-y-10': !isIntersecting})}
      priority={true}
      placeholder='blur'
      blurDataURL='data:image/png;base64,'
      />
    </div>
  )
}
